// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

contract structure{

    struct myDT{
        string name;
        uint age;
        address acc;
    }
    // myDT public a=myDT("rj",21,msg.sender);
  myDT a;
    function setValue(string memory _x,uint _y,address _z)public
    {
a=myDT(_x,_y,_z);
    }

}

